import React from "react";
import styled from "styled-components";
import NavbarComp from "../components/UI/NavbarComp";
import Head from "next/head";

const services = () => {
  return (
    <div>
      <Head>
        <title>Service</title>
        <link
          href="https://fonts.googleapis.com/css?family=Poppins|Quicksand|Racing+Sans+One&display=swap"
          rel="stylesheet"
        />
      </Head>
      <Container>
        <NavbarComp />
        <BannerBG>
          <div className="banner-title">
            <p>Services</p>
          </div>
        </BannerBG>
      </Container>
      <style jsx global>{`
        body {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }
      `}</style>
    </div>
  );
};

export default services;

const Container = styled.div`
  width: 100vw;
  line-height: 1.3;
  margin: 0;
  background-color: #151515;
  height: 100vh;
`;
const BannerBG = styled.div`
  width: 100vw;
  height: 60vh;
  background: url("/static/images/service/service-banner.png") top center
    no-repeat;
  background-size: cover;
  .banner-title {
    height: 60%;
    width: 100%;
    background: rgba(67, 67, 67, 0.44);
    height: 60%;
    transform: translate3d(0, 35%, 0);
  }
`;
